import React, { InputGroup, FormControl } from "react";

const AddProducts = () => {
  return (
    <div>
      <InputGroup className="mb-3">
        <FormControl
          placeholder="Recipient's username"
          aria-label="Recipient's username"
          aria-describedby="basic-addon2"
        />
      </InputGroup>
    </div>
  );
};

export default AddProducts;
